    "https://react-getting-started-fd56d-default-rtdb.firebaseio.com/meetups.json"
  );

  return (
    <section>
      <h1>All Meetups</h1>
      <MeetupList meetups={DUMMY_DATA}></MeetupList>
    </section>
  );
}

export default AllMeetupsPage;
